        "content": {
            "text": "5.3.3 Surfacing the Chaining structure increased transparency.Chaining enriched system transparency, which helped participantsbetter calibrate their expectations of the model. As each step of theChain had a specific role (Ideation, Rewriting, etc.), they helped nar-row the scope of the model’s intended functionality, making it easierfor participants to understand what to expect from a model thatmight otherwise seem all-encompassing. Nine participants notedthis benefit of calibrated expectations. For example, P6 commentedthat “Chaining helped you speak the language. It lift[ed] up the hoodand showed you the steps and what’s happening at different phrases,”and P15 stated that “having default settings like your templates gaveme an idea of how it works.” As elaborated in Section 5.3.2, havingisolated steps, each with a reduced scope, also enabled users to bet-ter anticipate the potential impact of their inputs, further increasingsystem transparency.More globally, Chaining enabled users to develop a more accu-rate mental model of the LLM’s capabilities, by allowing them totinker with sub-components in a modular and comparative manner.Users could, for example, compare parallel paths to deduce howthe model would respond to alternative inputs. In the Flashcardtask, P8 noticed during the Ideation step that the model generatedmore useful English sentences when the •types of interactionswas “accommodation,” compared to “topics related to public trans-portation.” This hinted at the model’s better performance whenpresented with a useful keyword. Modifying the order of LLM stepsalso enabled users to learn aspects of the model’s strengths andweaknesses. When customizing the Chaining structure, five par-ticipants tried adding another Rewriting step either after the finalparagraph (at the end of the Chain), or on the individual presenta-tion problems (early in the Chain). Though initially unaware thatLLMs can suffer from exposure bias (see C.2), participants quicklydiscovered through this comparison that the model could moreeffectively modify sentences than paragraphs. This comparison wasrare in Sandbox, as it was not obvious to participants that theycould keep the LLM functionality but shorten the input."
        },
