        "content": {
            "text": "Existing literature exposes three main challenges that LLMs face:C.1 LLMs lack multi-step reasoning capabilities. BecauseLLMs are designed to grasp the form of language, ratherthan the meaning [7], they can struggle on tasks like se-quential arithmetic problems, multi-hop question answering,recognizing and comparing sentences, or those that requirebranching logic [9, 11, 26, 66, 67].C.2 LLMs suffer from exposure bias [53, 61]. Because LLMsgenerate text sequentially in an autoregressive manner (thetokens generated by the models are themselves used topredict the next word), errors or imperfections from pre-vious runs can accumulate. Thus, LLMs are less likely toperform well when generating long bodies of text. Exposurebias can also cause LLMs to produce redundant content, insome severe cases repeating the same phrase over and overagain [30, 68]. As a result, they struggle to generate text withdiverse themes or arguments (e.g., suggestions for all threeproblems in the peer review example in Figure 1).C.3 LLMs are sensitive to input prompts. They tend to favorcertain prompt formats, paraphrases [45, 51], or even certaininformation in the input. For example, prompts that areunnatural relative to the typical text distribution tend to beless efficient [11], while nouns and verbs are more importantthan adjectives and function words [51]."
        },
