        "content": {
            "text": "The relative ease of natural-language-based prompt program-ming suggests that LLMs may be useful assistants for real-worldtasks, with users customizing the models to their own needs. Inthis light, recent work in Natural Language Processing (NLP) hasbegun to examine the algorithmic capabilities of LLMs, mostly onsynthesized tasks [26, 55, 66]. However, many real-world tasks canbe quite complex (e.g., outlining long essays, debugging softwarecode), and may present challenges for current LLMs to solve froma single model run. For example, as LLMs learn the forms of lan-guage [7], they produce lower quality outputs when solving tasksthat require multi-step reasoning [11, 61, 67]. Likewise, they mayfail to capture the subtleties of many tasks that involve multipleobjectives simultaneously (e.g., identifying and fixing multiple bugsin a code snippet). Figure 1 shows a task involving multiple con-current objectives: (1) to rewrite peer feedback to be more friendly,and (2) to rewrite it with additional concrete suggestions, and (3)to ensure that each noted sub-problem (e.g., too many words onslides, presentation meaders, does not engage with audience) isaddressed. While an LLM can both generate suggestions [1] andadjust the tone in isolation (e.g., in [3]), it lacks the capability toperform both tasks together well in an end-to-end manner. As aresult, it produces a mediocre paragraph that only meets a fewrequirements (see output of Figure 1A)."
        },
